import { jsPDF } from "jspdf";

export const gerarPDF = async (
  dadosPaciente,
  dadosMedico,
  medidas,
  conclusoes,
  imagem
) => {
  const pdf = new jsPDF("p", "mm", "a4");
  const pageWidth = pdf.internal.pageSize.getWidth();
  const pageHeight = pdf.internal.pageSize.getHeight();
  const margin = 20;
  const contentWidth = pageWidth - margin * 2;

  // ===== PÃGINA 1: LAUDO =====

  let y = 20;

  // ========== LOGO PREVENCOR ==========
  // ðŸ”´ COLE O BASE64 DA LOGO AQUI (linha que vocÃª pulou)
  const logoBase64 =
    "data:image/png;base64,"; // Cole o base64 completo aqui

  // DimensÃµes proporcionais (2,3 cm altura x 10,8 cm largura)
  const logoHeight = 2.3 * 10;
  const logoWidth = 10.8 * 10;
  const logoX = (pageWidth - logoWidth) / 2;

  // Adicionar a logo ao PDF
  pdf.addImage(logoBase64, "PNG", logoX, y, logoWidth, logoHeight);
  y += logoHeight + 25; // EspaÃ§o apÃ³s a logo

  // ===== TÃTULO =====
  pdf.setTextColor(0, 0, 0);
  pdf.setFontSize(18);
  pdf.setFont("helvetica", "bold");
  pdf.text("ELETROCARDIOGRAMA", pageWidth / 2, y, { align: "center" });

  y += 15;

  // Linha divisÃ³ria
  pdf.setDrawColor(200, 200, 200);
  pdf.setLineWidth(0.5);
  pdf.line(margin, y, pageWidth - margin, y);

  y += 10;

  // ===== DADOS DO PACIENTE =====
  pdf.setTextColor(30, 58, 95);
  pdf.setFontSize(10);
  pdf.setFont("helvetica", "bold");
  pdf.text("PACIENTE:", margin, y);
  pdf.setFont("helvetica", "normal");
  pdf.setTextColor(60, 60, 60);
  pdf.text(dadosPaciente.nome.toUpperCase(), margin + 25, y);

  if (dadosPaciente.cpf || dadosPaciente.idade) {
    y += 6;
    let infoExtra = [];
    if (dadosPaciente.cpf) infoExtra.push(`CPF: ${dadosPaciente.cpf}`);
    if (dadosPaciente.idade)
      infoExtra.push(`Idade: ${dadosPaciente.idade} anos`);
    pdf.setFontSize(9);
    pdf.text(infoExtra.join("   |   "), margin, y);
  }

  y += 12;

  // Linha divisÃ³ria
  pdf.setDrawColor(200, 200, 200);
  pdf.setLineWidth(0.5);
  pdf.line(margin, y, pageWidth - margin, y);

  y += 10;

  // ===== MEDIDAS DO ECG =====
  pdf.setFillColor(245, 247, 250);
  pdf.rect(margin, y - 4, contentWidth, 24, "F");

  pdf.setFontSize(9);
  const medCol1 = margin + 5;
  const medCol2 = margin + 60;
  const medCol3 = margin + 115;

  // Linha 1
  pdf.setTextColor(30, 58, 95);
  pdf.setFont("helvetica", "bold");
  pdf.text("FC", medCol1, y + 2);
  pdf.text("QRS", medCol2, y + 2);
  pdf.text("QT", medCol3, y + 2);

  pdf.setTextColor(60, 60, 60);
  pdf.setFont("helvetica", "normal");
  pdf.text(medidas.fc ? `${medidas.fc} bpm` : "â€” bpm", medCol1 + 15, y + 2);
  pdf.text(medidas.qrs ? `${medidas.qrs} ms` : "â€” ms", medCol2 + 15, y + 2);
  pdf.text(medidas.qt ? `${medidas.qt} ms` : "â€” ms", medCol3 + 15, y + 2);

  // Linha 2
  y += 10;
  pdf.setTextColor(30, 58, 95);
  pdf.setFont("helvetica", "bold");
  pdf.text("PRi", medCol1, y + 2);
  pdf.text("Eixo", medCol2, y + 2);
  pdf.text("QTc", medCol3, y + 2);

  pdf.setTextColor(60, 60, 60);
  pdf.setFont("helvetica", "normal");
  pdf.text(medidas.pr ? `${medidas.pr} ms` : "â€” ms", medCol1 + 15, y + 2);
  pdf.text(medidas.eixo ? `${medidas.eixo}Â°` : "â€”Â°", medCol2 + 15, y + 2);
  pdf.text(medidas.qtc ? `${medidas.qtc} ms` : "â€” ms", medCol3 + 15, y + 2);

  y += 18;

  // Linha divisÃ³ria
  pdf.setDrawColor(200, 200, 200);
  pdf.line(margin, y, pageWidth - margin, y);

  y += 10;

  // ===== CONCLUSÃƒO =====
  pdf.setTextColor(30, 58, 95);
  pdf.setFontSize(11);
  pdf.setFont("helvetica", "bold");
  pdf.text("ConclusÃ£o:", margin, y);

  y += 8;

  pdf.setTextColor(40, 40, 40);
  pdf.setFontSize(10);
  pdf.setFont("helvetica", "normal");

  conclusoes.forEach((conclusao) => {
    const lines = pdf.splitTextToSize(`â€¢ ${conclusao}`, contentWidth - 10);
    lines.forEach((line) => {
      if (y > pageHeight - 60) {
        return;
      }
      pdf.text(line, margin + 5, y);
      y += 6;
    });
  });

  // ===== DATA =====
  y = pageHeight - 55;
  const dataAtual = new Date().toLocaleDateString("pt-BR");
  pdf.setFontSize(9);
  pdf.setTextColor(100, 100, 100);
  pdf.text(dataAtual, pageWidth - margin, y, { align: "right" });

  // ===== ASSINATURA COM RUBRICA =====
  y += 10;

  // ConfiguraÃ§Ãµes da imagem da rubrica
  const rubricaWidth = 60; // Largura da imagem da rubrica em mm
  const rubricaHeight = 25; // Altura da imagem da rubrica em mm
  const rubricaX = (pageWidth - rubricaWidth) / 2; // Centralizada
  const rubricaY = y - 5; // PosiÃ§Ã£o Y (atrÃ¡s dos outros elementos)

  // Adicionar imagem da rubrica (atrÃ¡s dos textos)
  try {
    // Carrega a imagem da rubrica de forma assÃ­ncrona
    await new Promise((resolve, reject) => {
      const rubricaImg = new Image();
      rubricaImg.crossOrigin = "anonymous";
      rubricaImg.onload = () => {
        // Adiciona a rubrica centralizada atrÃ¡s dos textos
        pdf.addImage(
          rubricaImg,
          "PNG",
          rubricaX,
          rubricaY,
          rubricaWidth,
          rubricaHeight
        );
        resolve();
      };
      rubricaImg.onerror = () => {
        console.warn("Imagem da rubrica nÃ£o encontrada");
        resolve(); // Continua mesmo sem a imagem
      };
      rubricaImg.src = "/assinatura_magno.png";
    });
  } catch (error) {
    console.warn("Erro ao carregar imagem da rubrica:", error);
  }

  // Linha da assinatura (por cima da rubrica)
  y += 15;
  pdf.setDrawColor(30, 58, 95);
  pdf.setLineWidth(0.3);
  pdf.line(pageWidth / 2 - 40, y, pageWidth / 2 + 40, y);

  y += 5;
  pdf.setTextColor(30, 58, 95);
  pdf.setFontSize(10);
  pdf.setFont("helvetica", "bold");
  pdf.text(dadosMedico.nome, pageWidth / 2, y, { align: "center" });

  y += 5;
  pdf.setFont("helvetica", "normal");
  pdf.setFontSize(9);
  pdf.text(dadosMedico.especialidade, pageWidth / 2, y, { align: "center" });

  y += 4;
  pdf.text(`${dadosMedico.crm} / ${dadosMedico.rqe}`, pageWidth / 2, y, {
    align: "center",
  });

  // ===== PÃGINA 2: IMAGEM DO ECG =====
  if (imagem && imagem.type !== "application/pdf") {
    pdf.addPage();

    // Header simplificado
    pdf.setTextColor(0, 0, 0);
    pdf.setFontSize(14);
    pdf.setFont("helvetica", "bold");
    pdf.text("TRAÃ‡ADO ELETROCARDIOGRÃFICO", pageWidth / 2, 20, {
      align: "center",
    });

    // Linha divisÃ³ria
    pdf.setDrawColor(200, 200, 200);
    pdf.setLineWidth(0.5);
    pdf.line(margin, 25, pageWidth - margin, 25);

    // Info do paciente
    pdf.setTextColor(60, 60, 60);
    pdf.setFontSize(9);
    pdf.setFont("helvetica", "normal");
    pdf.text(`Paciente: ${dadosPaciente.nome}`, margin, 33);
    pdf.text(`Data: ${dataAtual}`, pageWidth - margin, 33, { align: "right" });

    // Imagem
    const img = new Image();
    img.src = imagem.preview;

    await new Promise((resolve) => {
      img.onload = () => {
        const imgWidth = img.width;
        const imgHeight = img.height;
        const maxWidth = contentWidth;
        const maxHeight = pageHeight - 60;

        let finalWidth = maxWidth;
        let finalHeight = (imgHeight / imgWidth) * maxWidth;

        if (finalHeight > maxHeight) {
          finalHeight = maxHeight;
          finalWidth = (imgWidth / imgHeight) * maxHeight;
        }

        const x = (pageWidth - finalWidth) / 2;
        const yImg = 45;

        pdf.addImage(imagem.preview, "JPEG", x, yImg, finalWidth, finalHeight);
        resolve();
      };
    });
  }

  // ===== SALVAR PDF =====
  const nomeArquivo = `ECG_${dadosPaciente.nome.replace(
    /\s+/g,
    "_"
  )}_${dataAtual.replace(/\//g, "-")}.pdf`;
  pdf.save(nomeArquivo);
};
